"use strict";

// Функция ymaps.ready() будет вызвана, когда
// загрузятся все компоненты API, а также когда будет готово DOM-дерево.

function init() {
  // Создание карты по id="map"
  var myMap = new ymaps.Map("map", {
    // Координаты центра карты.
    // Порядок по умолчанию: «широта, долгота».
    // Чтобы не определять координаты центра карты вручную,
    // воспользуйтесь инструментом Определение координат.
    center: [55.76953456898229, 37.63998549999998],
    // Уровень масштабирования. Допустимые значения:
    // от 0 (весь мир) до 19.
    zoom: 14
  });
  // убираем лишние элементы с карты
  myMap.controls.remove('searchControl'); // поиск
  myMap.controls.remove('geolocationControl'); // геолокацию
  myMap.controls.remove('trafficControl'); // трафик
  myMap.controls.remove('typeSelector'); // тип
  myMap.controls.remove('rulerControl'); // контрол правил
  myMap.controls.remove('zoomControl'); // контрол зуммирования
  myMap.controls.remove('fullscreenControl'); // переход в полноэеранный режим
  myMap.behaviors.disable(['scrollZoom']); // скролл карты

  // Создание геообъекта с типом точка (метка).
  var myGeoObject = new ymaps.GeoObject({
    geometry: {
      type: "Point",
      // тип геометрии - точка
      coordinates: [55.76953, 37.63999] // координаты точки
    }
  });

  var myPlacemark = new ymaps.Placemark([55.76953, 37.63999], {}, {
    iconLayout: 'default#image',
    iconImageHref: 'images/point.svg',
    iconImageSize: [12, 12],
    iconImageOffset: [0, 0]
  });

  /*  БАЛУН     let myPlacemark = new ymaps.Placemark([55.76953, 37.63999],  {
    balloonContent: `
    <div class="balloon">
      <div class="ballon__block">
      <h2 class="baloon__title"><svg width="26" height="25" viewBox="0 0 26 25" fill="none" xmlns="http://www.w3.org/2000/svg">
      <path fill-rule="evenodd" clip-rule="evenodd" d="M5.5 5V20H20.5L5.5 5ZM0.5 0V25H25.5V0H0.5Z" fill="#FF6E30"/>
      </svg> High pass</h2>
      </div>
    </div>
    `
  }, {
    iconLayout: 'default#image',
    iconImageHref: 'images/point.svg',
    iconImageSize: [12, 12],
    iconImageOffset: [0, 0]
  }); */

  // Размещение геообъекта на карте.
  myMap.geoObjects.add(myPlacemark); // мой знак
  //    myMap.geoObjects.add(myGeoObject); // стандартный
  //    myPlacemark.balloon.open(); // открытая метка

  myPlacemark.events.add('click', function () {
    document.querySelector('.contacts__block-address').classList.add('contacts-card-show');
  });
  document.querySelector('.map-closed').addEventListener('click', function () {
    document.querySelector('.contacts__block-address').classList.remove('contacts-card-show');
    //  alert('Добро пожаловать к нам в студию!')
  });
}

;
ymaps.ready(init);
